_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "This fixes a bug where the first reset delta reported to the control loops\
    \ following a core select switch will be erroneous if the EKF that has been selected\
    \ has previously experienced a reset.\r\n\r\nAddresses an issue discussed here:\
    \ https://github.com/ArduPilot/ardupilot/pull/5252#issuecomment-263035749\r\n\r\
    \n**Testing**\r\n\r\nHere is the testing of the updated logic for the vertical\
    \ position reset performed in SITL. The EK2_HGT_I_GATE param was set to 100 and\
    \ the IMU2 Z accel offset set to 2.0 temporarily to force a reset of the IMU2\
    \ EKF core. The IMU1 Z accel offset was then set temporarily to 2.0 to force a\
    \ core switch. Temporarily logging of the reset event time DBG.ResetMS and reset\
    \ delta DBG.POSZ was added to assist with verification:\r\n\r\n![screen shot 2016-11-30\
    \ at 10 56 40 am](https://cloud.githubusercontent.com/assets/3596952/20734384/2662b76a-b6ed-11e6-8d40-49f49718d06f.png)\r\
    \n\r\nPosition reset testing is harder to perform using SITL and required a combination\
    \ of reducing the position innovation gate size and setting large roll gyro offsets\
    \ to induce large position innovations. Here are the east positions from the two\
    \ EKF cores, controller and controller set-point. The second cores is made to\
    \ diverge and reset first, then the first core to induce a core switch.\r\n![screen\
    \ shot 2016-11-30 at 11 31 37 am](https://cloud.githubusercontent.com/assets/3596952/20734897/92bc248e-b6f0-11e6-9eeb-263a8d9b4d92.png)\r\
    \n\r\nZooming into the switch event we can see the single East position reset\
    \ delta consumed by the controller logged in DBG.POSY\r\n![screen shot 2016-11-30\
    \ at 11 36 06 am](https://cloud.githubusercontent.com/assets/3596952/20735010/33d34456-b6f1-11e6-82bd-d7b02a3bd589.png)\r\
    \n\r\nThe yaw reset was simulated by setting both SIM_MAG_ALY_X and SIM_MAG_ALY_Y\
    \ to -300 to simulate a large initial yaw angle error. The IMU2 yaw gyro offset\
    \ was also set to 0.05 after alignment to casue the second EKF core to have a\
    \ different heading error to the first. the copter was climbed to below 5m to\
    \ avoid the final yaw reset and a core switch initiated by setting the first IMU\
    \ X gyro bias to 0.2. The reset delta consumed by the yaw controller was logged\
    \ in DB3.YAW and the timestamp in DB3.ResetMS.\r\n\r\n![screen shot 2016-11-30\
    \ at 12 04 13 pm](https://cloud.githubusercontent.com/assets/3596952/20735716/10cc950c-b6f6-11e6-8bf0-8bdec3ce14c9.png)\r\
    \n\r\nZooming into the core switch event we can see the controller set-point follows\
    \ the reset and the reset delta is consistent with the core switch, ignoring the\
    \ previous internal reset on the IMU2 EKF.\r\n\r\n![screen shot 2016-11-30 at\
    \ 12 06 39 pm](https://cloud.githubusercontent.com/assets/3596952/20735740/389cab6c-b6f6-11e6-9ec5-2654b8c59242.png)\r\
    \n\r\n\r\n\r\n"
